
DROP TABLE IF EXISTS `operox`.`COUNTRIES`;
CREATE TABLE `operox`.`COUNTRIES` (
  ID BIGINT NOT NULL AUTO_INCREMENT,
  Code VARCHAR(3) DEFAULT NULL,
  Name VARCHAR(52) DEFAULT NULL,
  Continent VARCHAR(50) DEFAULT NULL,
  Region VARCHAR(30) DEFAULT NULL,
  LocalName VARCHAR(45) DEFAULT NULL,
  Code2 VARCHAR(2) DEFAULT NULL,
  currency VARCHAR(45) DEFAULT NULL,
  flagPath varchar(250) DEFAULT NULL,
  PRIMARY KEY (`ID`) 
); 

DROP TABLE IF EXISTS `operox`.`STATES`;
CREATE TABLE `operox`.`STATES` (
  ID BIGINT(20) NOT NULL AUTO_INCREMENT,
  countryCode VARCHAR(5) NOT NULL,
  stateCode VARCHAR(20) NOT NULL,
  stateName VARCHAR(100) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ;

DROP TABLE IF EXISTS `operox`.`TIMEZONE`;
CREATE TABLE `operox`.`TIMEZONE` (
  `countryCode` varchar(2)  DEFAULT NULL,
  `timezoneid` varchar(255)  DEFAULT NULL,
  `gmtoffset` float DEFAULT NULL,
  `dstoffest` float DEFAULT NULL,
  `rawoffset` float DEFAULT NULL
);

set foreign_key_checks = 0;
drop table IF EXISTS operox.`webgeocities`;
set foreign_key_checks = 1;

CREATE TABLE operox.`webgeocities` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `countryCode` varchar(2) COLLATE utf8_persian_ci DEFAULT NULL,
  `stateCode` varchar(20) COLLATE utf8_persian_ci DEFAULT NULL,
  `cityName` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `cityNameAscii` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `latitude` float DEFAULT NULL,
  `longitude` float DEFAULT NULL,
  `timezoneid` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  PRIMARY KEY (`ID`),
  INDEX `countryCode` (`countryCode`,`stateCode`)
);

alter table `operox`.`webgeocities` convert to character set utf8 collate utf8_general_ci;











